(38203, '32C07F90-2BB0-495D-8D05-8035C593833E', 'Love, wish I could help you (and I) feel more settled. I’ve been feeling anxious and sad and just out of sorts since we were in the park…and then feeling rushed for the airport and forgetting stuff, and the bike, and the flight and the luggage…and then a small thing like not knowning where  my glasses are somehow feels like a much bigger deal.  I love you and i want you to have as much joy and connection as possible in this life….first and foremost with me. You know how much I like Ken and I understand your draw toward him… and as I said … the guy deserves as much love (and sex) as he can get. I know you will honor our agreements, so within those boundaries…you have your own box to play in. When you told me last night, I wasn’t surprised, and had it been all above board, I think I could have just felt good for you.  But, unfortunately, it’s more complex. I honor that you have a different way of approaching non-monogamy and as long as these relationships are within our agreements, Ken and garrett, and mike and joe and others…are within bounds. You choose… But i wouldn’t be true to myself if I didn’t share how I feel. It’s not the moralizing voice that’s dominating here. It just feels like “ouch” ….because while our bond remains strong ….another one is straining. And I can’t help but feel that when receiving your stories. I feel like I’m witnessing joy and connection….but mixed with harm from an agreement being broken. So, like all good stories, it’s complicated with conflicting emotions. And I can’t just choose the ones I want to see and feel….it wouldn’t be authentic.  We agreed to honesty and transparency, so I’m sharing how I feel, honestly. Can I learn to tolerate the discomfort….probably.  Does it change how I feel about you? No. I absolutely adore you.   And just like you accept me and love me despite my many imperfections, we are both imperfect beings working through a minefield. And I am here with you every step…as each step shines the light on new discoveries ahead. While sometimes the source of the energy is my own stuff to work through….which I’ve tried to let you in on that messy strange process, sometimes I’m also hopefully shining a mirror back at you. I’m now falling asleep…and maybe not so coherent. But I hope you know that even when I’m feeling a bit out to sea….I will also be on my way back to you. Did you catch the line on one of the songs I played for you, Exiles?” Every step away, is a step toward home”. Home is me and you and the stories we are writing together….my pair body. I love you.  ', '659263780951013376', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2021-11-22T00:49:40.951013'),
