(38302, '30102FA4-7777-44BF-8E78-7208840428DC', 'Hey love, bummed that I’m not with you tonight and can’t wait for you and Orli to get here. Things are chill…everyone on good behavior, and we are having fun. Had a chance to have a long conversation with jonathan and just had a nice chat with nathan…he is doing much better and has an improved attitude…will update you later.  Am spending a bit more time re-listening to poly secure. I’d really like to talk through some of it with you…although I’m also Enjoying just reading a real book and not thinking about relationship intensity. This has been difficult few days and I want to not suck the joy out. Please know, again….I want you to be able to explore the way that works for you. It is your box to play in. We can make this work.  Been keeping in my mind the vision of you coming home on Saturday and how you just casually, unconsciously started to peel off your blue dress…the way you cross your arms to pull it over your head….all while talking to me about your night. I still get such a jolt of excitement seeing you and your beauty…and then you come in bed with me. It’s really the best…when we are in our space together, the two of us without anything in the world or anybody else. These are some of my happiest moments.', '659338407636461952', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2021-11-22T21:33:27.636462'),
